require("dotenv").config();
const axios = require("axios");

async function validateAppleReceipt(receiptData) {
    try {
        const response = await axios.post(
            "https://sandbox.itunes.apple.com/verifyReceipt",
            {
                "receipt-data": receiptData,
                password: process.env.IOS_SHARED_SECRET,
            }
        );

        if (response.data.status === 0) {
            // ----- log all keys and their types, used for debugging. -----
            // const keys = Object.keys(response.data);
            // keys.forEach((key) => {
            //     console.debug(
            //         `Key: ${key}, Type: ${typeof response.data[key]}`
            //     );
            // });

            // ----- destructure verifyReceipt endpoint response into its seperate keys. -----
            const {
                environment,
                latest_receipt_info,
                latest_receipt,
                pending_renewal_info,
                status,
            } = response.data;

            // ----- log enviroment value, should either be sandbox or production. -----
            // console.debug(environment);

            // ----- log latest receipt info. -----
            const filteredObject = latest_receipt_info.find((item) => {
                return (
                    item.original_transaction_id ===
                    pending_renewal_info[0].original_transaction_id
                );
            });

            console.debug(filteredObject);

            // ----- log latest receipt in base64. -----
            // console.debug(latest_receipt);

            // ----- log pending renewal_info. -----
            // console.debug(pending_renewal_info);

            // ----- log status. -----
            // console.debug(status);
        } else {
            console.debug("Receipt is invalid:", response.data);
        }
    } catch (error) {
        console.error("Error validating receipt:", error);
    }
}

const receiptData =
    "";
validateAppleReceipt(receiptData);
